import React from 'react';

import './error_page.styles.scss';

export default function ErrorPage(props) {
    return (
        <div id="notfound">
            <div class="notfound">
                <div class="notfound-404">
                    <h1>Oops!</h1>
                    <h2>500 - OUR SERVER IS ON A BREAK</h2>
                </div>
                <a href="/#home">Go TO Homepage</a>
            </div>
        </div>
    )
}
